import React from 'react';

const MenuArea = () => {
    return (
        <div className="menuArea">
            <div className="searchArea">
                <div className="location">
                    <ul>
                        <li>경기도</li>
                        <li>고양시</li>
                        <li>일산동구</li>
                    </ul>
                    {/* Add your addressPop content here */}
                    <div className="addressPop">
                        {/* ... */}
                    </div>
                </div>
                <div className="searchBox">
                    <input type="text" placeholder="장소, 주소 또는 건물명 입력" style={{ width: '300px' }} />
                    <button type="button" className="btnSearch"><span className="hidden">검색</span></button>
                </div>
            </div>
            <button type="button" className="btn btnMenu"><span className="hidden">전체메뉴</span></button>
        </div>
    );
};

export default MenuArea;
